// ==UserScript==
// @name        OpenStudy Sound Notification
// @namespace   http://ask.fm/KamiIntelligence
// @description When you receive any notification on OpenStudy a chime plays.
// @include     http://openstudy.com/*
// @match       http://openstudy.com/*
// @version     1
// @grant       none
// @author      Kami Mikazuki <LinkToMeByProxy@gmail.com>
// ==/UserScript==

if (window.parent === window)
{
    unsafeWindow.console.info("Start GM script");
    var sndNotification = new Audio();
    sndNotification.src = "data:audio/mp3;base64,";
    sndNotification.load();

    unsafeWindow.console.info("Load SndNotification");

    var SndNotifyNotPlayed = true;

    var titleChanged = function() {
        if (!SndNotifyNotPlayed)
            return;
        SndNotifyNotPlayed = false;
        sndNotification.play();
    }

    var oldTitle = document.title;

    var isFocus = false;
    unsafeWindow.setInterval( function(e) {
        if (oldTitle !== document.title && !isFocus)
            titleChanged();
        oldTitle = document.title;
    }, 200);


    unsafeWindow.addEventListener("focus", 
                                  function(e) {
                                      SndNotifyNotPlayed = true;
                                      isFocus = true;
                                  },
                                  false);
    unsafeWindow.addEventListener("blur", 
                                  function(e) {
                                      SndNotifyNotPlayed = true;
                                      isFocus = false;
                                  },
                                  false);
}